	btst	8, %i5
	bz	_t1_not_ssl
	nop	
	add	%i5, 8, %i5

_t1_not_ssl:
	cmp	%i1, 8
	bg	_t1_fail
	mulx 	%i1, 8, %i1		!# Calc _t1_index _t1_into _t1_toc

	setx 	_t1_table_of_context, %l1, %l2
#ifdef SPU_8
#if  (MAX_THREADS > 8)
        ! Add core ID offset
        or %l2, %o1, %l2
#endif
#endif
	ldx 	[%l2 + %i1], %l3	!# l3 = _t1_toc _t1_of _t1_current _t1_operation
	ldx 	[%l3 + 0x40], %l4   	!# l4 = alignment array

