	inc	%i6			!# increase _t1_interrupt _t1_counter

_t1_write_cwq:
    	!# write CWQ entry (%l6 points to CWQ)
    	stx  	%l2, [%l6 + 0x0]

    	!# source address
	ldx 	[%l3 + 0x8], %l2
	ldx	[%l4 + 0x8], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x8]

    	!# Authentication Key  Address (40-bit)
	ldx	[%l3 + 0x10], %l2
	ldx	[%l4 + 0x10], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x10]

    	!# Authentication IV   Address (40-bit)
	ldx	[%l3 + 0x18], %l2
	ldx	[%l4 + 0x18], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x18]

    	!# Authentication FSAS Address (40-bit)
	ldx	[%l3 + 0x20], %l2
	ldx	[%l4 + 0x20], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x20]

    	!# Encryption Key Address (40-bit)
	ldx 	[%l3 + 0x28], %l2
	ldx	[%l4 + 0x28], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x28]

    	!# Encryption Initialization Vector Address (40-bit)
	ldx 	[%l3 + 0x30], %l2
	ldx	[%l4 + 0x30], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x30]

