    	ldx 	[%l3 + 0x38], %l2
	ldx	[%l4 + 0x38], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x38]

